usage.code:
ScheduledSensable scheduledSensable = new ScheduledSensable();
// Set the necessary properties for scheduledSensable
SensorEventListener listener = getListener(scheduledSensable);
sensorManager.registerListener(listener, sensor, SensorManager.SENSOR_DELAY_NORMAL);

public class MyActivity extends AppCompatActivity {

    private SensorManager sensorManager;
    private ScheduledSensableService scheduledSensableService;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);

        // Initialize the sensor manager and service
        sensorManager = (SensorManager) getSystemService(Context.SENSOR_SERVICE);
        scheduledSensableService = new ScheduledSensableService();

        // Start the service to begin sampling sensors
        Intent intent = new Intent(this, ScheduledSensableService.class);
        startService(intent);

        // Register a listener for changes in sensors
        sensorManager.registerListener(scheduledSensableService.getListener(new ScheduledSensable()), Sensor.TYPE_ACCELEROMETER, SensorManager.SENSOR_DELAY_NORMAL);
    }

    @Override
    protected void onDestroy() {
        super.onDestroy();
        // Unregister the listener to stop sampling sensors when the activity is destroyed
        sensorManager.unregisterListener(scheduledSensableService.getListener(new ScheduledSensable()));
    }
}

