public class MyActivity extends AppCompatActivity {

    private SensableLoginFragment sensableLoginFragment;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        // Inflate layout for the login fragment and show it as a dialog.
        sensableLoginFragment = new SensableLoginFragment();
        DialogFragment dialog = sensableLoginFragment;
        FragmentManager fragmentManager = getFragmentManager();
        dialog.show(fragmentManager, "sensable_login");

        // Set listener for the login functionality
        MySensableLoginListener mySensableLoginListener = new MySensableLoginListener();
        sensableLoginFragment.setSensableLoginListener(mySensableLoginListener);
    }

}

class MySensableLoginListener implements SensableLoginListener {
    @Override
    public void onConfirmed(UserLogin userLogin) {
        // Handle the confirmed login event, e.g. perform authentication and redirect to the main screen.
        Toast.makeText(MyActivity.this, "User logged in successfully", Toast.LENGTH_SHORT).show();
    }
}

public void onClick(View view) {
        SensableLoginFragment fragment = new SensableLoginFragment();
        View v = inflateLayout(R.layout.sensable_login_layout, null);
        fragment.setSensableLoginListener(new SensableLoginFragment.SensableLoginListener() {
            @Override
            public void onConfirmed(UserLogin userLogin) {
                // Handle the confirmed login event here
            }
        });
