params.description:
URI of the data to be queried, which determines whether the query is for all saved sensables or for a specific sensor ID.

Matched by SQLiteQueryBuilder with URI matcher sURIMatcher; 
URI type (SENSABLES or SENSABLE_ID) is obtained through matching.

